const Formitems = [
  {
    cName : 'form-group',
    label : [
      {for : 'fname'},
      {title : 'First Name:'}
    ],
    input : [
      {type : 'text'},
      {cName : 'form-control'},
      {placeholder : 'Enter Your First Name'},
      {name : 'fname'}
    ]
  },
  {
    cName : 'form-group',
    label : [
      {for : 'lname'},
      {title : 'Last Name:'}
    ],
    input : [
      {type : 'text'},
      {cName : 'form-control'},
      {placeholder : 'Enter Your Last Name'},
      {name : 'lname'}
    ]
  },
  {
    cName : 'form-group',
    label : [
      {for : 'email'},
      {title : 'Email:'}
    ],
    input : [
      {type : 'text'},
      {cName : 'form-control'},
      {placeholder : 'Enter Your Email'},
      {name : 'email'}
    ]
  }
]
 export default Formitems
